import React from "react";

class Header extends React.Component {
  render() {
    return (
      <div className="flex-row wide-font">
        <div>
          <svg xmlns="http://www.w3.org/2000/svg">
            <ellipse
              cx="1"
              cy="2"
              rx="1"
              ry="2"
              fillOpacity="0"
              stroke="blue"
            />
          </svg>
        </div>
        <div>Portal</div>
        <div className="flex-row">
          <div>About</div>
          <div>Save</div>
        </div>
      </div>
    );
  }
}

export default Header;
